import React,{PureComponent} from 'react';
import {} from './style';
import {connect} from 'react-redux';
import * as actionCreators from './store/actionCreators';
import { Menu, Button } from 'antd';
import {
    AppstoreOutlined,
    MenuUnfoldOutlined,
    MenuFoldOutlined,
    MailOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;

class Admin extends PureComponent {

    state = {
        collapsed: false,
    };

    toggleCollapsed = () => {
        this.setState({
            collapsed: !this.state.collapsed,
        });
    };

    render() {
        return (
            <div style={{ width: 256 }}>
                <Button type="primary" onClick={this.toggleCollapsed} style={{ marginBottom: 16 }}>
                    {React.createElement(this.state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined)}
                </Button>
                <Menu
                    defaultSelectedKeys={['1']}
                    defaultOpenKeys={['sub1']}
                    mode="inline"
                    theme="dark"
                    inlineCollapsed={this.state.collapsed}
                >

                    <SubMenu key="sub1" icon={<MailOutlined />} title="社团管理">
                        <Menu.Item key="5">添加社团</Menu.Item>
                        <Menu.Item key="6">查看社团</Menu.Item>
                        <Menu.Item key="7">修改社团</Menu.Item>
                        <Menu.Item key="8">删除社团</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub2" icon={<AppstoreOutlined />} title="用户管理">
                        <Menu.Item key="9">添加用户</Menu.Item>
                        <Menu.Item key="10">查看用户</Menu.Item>
                        <Menu.Item key="11">修改用户</Menu.Item>
                        <Menu.Item key="12">删除用户</Menu.Item>

                    </SubMenu>
                </Menu>
            </div>
        );
    }

}
const mapState = (state) => ({

})

const mapDispatch = (dispatch) => ({

});
export default connect(mapState,mapDispatch)(Admin);
